Multiply field in array of object by Mongo aggregation pipeline<p>Given the following record:</p>

<pre><code>{
  "_id": "5ebe47995dc5b683d050c396",
  "date": "2020-05-05 00:00:00",
  "insertTime": "2020-05-15 15:41:13.039000",
  "resultSummary": {
    "total": [
      {
        "date": "2019-09-12 00:00:00",
        "actualCost": 123,
      },
      {
        "date": "2019-09-13 00:00:00",
        "actualCost": 456,
      }
    ]
  }
}
</code></pre>

<p>I want to multiply <code>actualCost</code> by 100 using Mongo aggregation.</p>

<p>Expected outcome:</p>

<pre><code>{
  "_id": "5ebe47995dc5b683d050c396",
  "date": "2020-05-05 00:00:00",
  "insertTime": "2020-05-15 15:41:13.039000",
  "resultSummary": {
    "total": [
      {
        "date": "2019-09-12 00:00:00",
        "actualCost": 12300,
      },
      {
        "date": "2019-09-13 00:00:00",
        "actualCost": 45600,
      }
    ]
  }
}
</code></pre>

<p>What I tried:</p>

<pre><code>{'$set':
     {'resultSummary.total.actualCost': {'$multiply': ['$resultSummary.total.$.actualCost', 100]},
     }
}
</code></pre>

<p>However it seems Mongo cannot recognise $ and gives</p>

<pre><code>Error: FieldPath field names may not start with '$'
</code></pre>

