<pre><code>    displayItems() {
      fetch('/getItems',{
        method: "get",
      }).then(response =&gt; {
        return response.json();
      }).then((data)=&gt;{
        this.items = data
      });
    }
</code></pre>

<p>app.js:</p>

<pre><code>app.get('/getItems', (req,res)=&gt;{      
  db.getDB().collection(tableName).find({}).toArray((err,documents)=&gt;{
