<p>I tried different ways, couldn't achieve it yet. In the below query, I have hardcoded date ISODate(&quot;2020-05-20T02:36:00Z&quot;) instead of using members.joined property. How can I write an optimized query to achieve the same?</p>
<pre><code>db.coll.aggregate([
