<p>The problem is, I get the following exception when I navigate to <code>http://localhost:56103/health</code>. (I was expecting to see the UI with the health info for mongodb.)</p>

<pre><code>An unhandled exception occurred while processing the request.
InvalidOperationException: Unable to resolve service for type 'System.String' while attempting to activate 'HealthChecks.MongoDb.MongoDbHealthCheck'.
</code></pre>

<p>Three questions:</p>

<p>1) What am I missing when setting up the health checks and the service ?</p>

<p>2) Does the <code>.AddMongoDb( . . .)</code> initializes IMongoClient ? is it doing something similar to <code>services.AddSingleton&lt;IMongoClient&gt;(mongoClient);</code> ?</p>

<p>3) What configurations do I have to add to get similar UI (<a href="https://learn.microsoft.com/en-us/dotnet/standard/microservices-architecture/implement-resilient-applications/monitor-app-health" rel="nofollow noreferrer">similar what is shown in this doc</a>)</p>

<p>Here is part of <code>Startup.cs</code>code I am working with:</p>

<pre><code>public IServiceProvider ConfigureServices(IServiceCollection services)
        {
            var config = Configuration.Get&lt;Config&gt;();

            ConfigureMvc(services, config);
            ConfigureDatabase(services, config);
            ConfigureHealthChecks(services, config);


            var containerBuilder = ConfigureDependencyResolver();
            containerBuilder.Populate(services);
            ConfigureLogger(containerBuilder, config);
            _container = containerBuilder.Build();

            return new AutofacServiceProvider(_container);
        }
        public void Configure(IApplicationBuilder app, IHostingEnvironment env)
        {
            //Middleware setups 
            if (env.IsDevelopment())
            {
                app.UseDeveloperExceptionPage();
            }

            app.UseHealthChecks("/health", new HealthCheckOptions
