How to remove properties of mongo objects in an array?<p>I hope the snippets below make my question more clearer. I can fetch an object that has embedded an array of category objects. From the category objects I want to show only certain properties.</p>

<p>So this is what I get now:</p>

<pre><code>{
  "photo": [],
  "_id": "5ec55ae39eere8ert85bf8fe749",
  "title": "Blog about coding",
  "description": "Hi, I want to share with you my incredible journey as a software developer...",
  "rate": 3,
  "category": [
    {
      "_id": "5ec55ae39aaa78985f8fe74a",
      "name": "programming",
      "display_name": "Programming"
    }
  ],
  "createdAt": "2020-05-20T16:29:23.982Z",
  "updatedAt": "2020-05-20T16:29:23.982Z",
  "__v": 0
